var InitPromise = null;

async function ensureInitialized() {
  if (InitPromise) return InitPromise;
  if (Initialized) return true;

  InitPromise = (async () => {
    const moduleInstance = await Module(Luau);

    Object.assign(Luau, moduleInstance);

    Initialized = true;
    return true;
  })();

  return InitPromise;
}

